import { getDataMenu } from "./getDataMenu";

const LayOutDataMenu = () => {
    const [data, setData] = useState([])
    useEffect(
        () => {
            const fetchApi = async() => {
                const response = await getDataMenu();
                setData(response)
            }
            fetchApi();
        }
    )
    return (
        <div>
